import React, {Fragment, useEffect, useState} from 'react';

import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import IconButton from '@material-ui/core/IconButton';
import Button from '@material-ui/core/Button';
import {db} from '../FirebaseDb.js';
import firebase from "firebase";

import { useHistory } from "react-router-dom";

const FinishConversation = (props) =>{

                       
                       const history = useHistory();

                       const [openAviso, setOpenAviso] = React.useState(false);

                        const handleClickOpen = () => {
                        setOpenAviso(true);
                        };

                        const handleClose = () => {
                        setOpenAviso(false);
                        };


                        const [seleccion, setSeleccion]=useState([])
                        useEffect(() =>{

                        const unsubscribe = db.collection('integrantesTemporal').onSnapshot(snapshot =>(

                        setSeleccion(snapshot.docs.map(doc =>
                        (

                        doc.data().integrantes

                        ))
                        )
                        ));

                            return () =>{
                                unsubscribe();
                                
                            }

                        }, [])



                        const [seleccionPase, setSeleccionPase]=useState([])
                         useEffect(() =>{

                        const unsubscribe = db.collection('integrantesTemporal').onSnapshot(snapshot =>(

                        setSeleccionPase(snapshot.docs.map(doc =>
                        (

                        doc.data().integrantesPase

                        ))
                        )
                        ));

                            return () =>{
                                unsubscribe();
                                
                            }

                            

                        }, [])


                        var user = firebase.auth().currentUser;
                        var name, email, photo, uid, emailVerified;

                        name = user.displayName;
                        email = user.email;
                        photo = user.photoURL;
                        emailVerified = user.emailVerified;
                        uid = user.uid;



                        const [salir, setSalir]= useState([])
                        
                        const salirChat = () =>{
                            
                            var salida = props.integrantesPase.filter(seleccionPase=> seleccionPase!==email)

                            if(props.admin == email){

                                db.collection("rooms").doc(props.id).delete().then(function() {
                                    console.log("Document successfully deleted!");
                                    }).catch(function(error) {
                                        console.error("Error removing document: ", error);
                                    })


                            }else if (props.admin!==email) {

                                db.collection("rooms").doc(props.id).update({
                               
                                    integrantesPase:salida, 
                                   
                               })

                            }


   
                           setOpenAviso(false)

                           history.push("/messenger")
   
                        }
           
     

        if(props.integrantesPase.includes(email)){


                    return (

                        <Fragment>

                                            <IconButton aria-label="delete" onClick={handleClickOpen} style={{border:'1px solid grey'}}>
                                                        <ExitToAppIcon  />
                                            </IconButton>



                                            <Dialog
                                                    open={openAviso}
                                                    onClose={handleClose}
                                                    aria-labelledby="alert-dialog-title"
                                                    aria-describedby="alert-dialog-description"
                                                    >
                                                    <DialogTitle id="alert-dialog-title">{"Quieres Salir de este grupo?"}</DialogTitle>
                                                    <DialogContent>
                                                        
                                                    </DialogContent>
                                                    <DialogActions>
                                                        <Button onClick={handleClose} color="primary">
                                                        Cancelar
                                                        </Button>
                                                        <Button onClick={salirChat} color="primary" autoFocus>
                                                        Salir del grupo
                                                        </Button>
                                                    </DialogActions>
                                            </Dialog>

                        </Fragment>

                    )} else if (props.admin.includes(email)){  



                        return (

                            <Fragment>
    
                                                <IconButton aria-label="delete" onClick={handleClickOpen} style={{border:'1px solid grey'}}>
                                                            <ExitToAppIcon  />
                                                </IconButton>
    
    
    
                                                <Dialog
                                                        open={openAviso}
                                                        onClose={handleClose}
                                                        aria-labelledby="alert-dialog-title"
                                                        aria-describedby="alert-dialog-description"
                                                        >
                                                        <DialogTitle id="alert-dialog-title">{"Quieres Salir de este grupo?"}</DialogTitle>
                                                        <DialogContent>
                                                            
                                                        </DialogContent>
                                                        <DialogActions>
                                                            <Button onClick={handleClose} color="primary">
                                                            Cancelar
                                                            </Button>
                                                            <Button onClick={salirChat} color="primary" autoFocus>
                                                            Salir del grupo
                                                            </Button>
                                                        </DialogActions>
                                                </Dialog>
    
                            </Fragment>
    
                        )
                    
                    
                    
                    
                    }else {

                        return(
                            <Fragment>

                            </Fragment>
                        )
                    }

    
}

export default FinishConversation;
